  true,\n\t\"url\": null,\n\t\"notes\": \"The Report of VA Medical Training Programs
  Database is used to track medical center health services trainees and VA physicians
  serving as faculty. The database also tracks the number of U.S. and international
  medical residents on-duty at a Veterans Affairs Medical Center (VAMC). Information
  in the database comes from all VAMCs that have residency programs. The Office of
  Academic Affiliations distributes worksheets and memos to participating VAMCs annually.
  VAMC personnel enter the information electronically into the database located at
  the Academic Information Management Center (AIMC) in St. Louis, Missouri. The main
  user of this database is the Office of Academic Affiliations which uses the reports
  from the system to assist in its decision making.\",\n\t\"license_title\": \"Creative
